import ExpenseItem from "./component/ExpenseItem";
// import ExpenseInpute from "./component/ExpenseInpute";
function App() {
  let expence=[
    { id:1,
      Date:new Date(2021,3,28),
      Title:"school fee",
      Amount:200
    }
  ]

  return (
    <div className="App">
      {/* <ExpenseInpute /> */} 
      <h1>Lets Start</h1>
      <ExpenseItem date={expence[0].Date}
      title={expence.Title}
      amount={expence.Amount} />
         </div>
  );
}

export default App;
